import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Updated import
import { listAll } from '../../../../services/FreelancerService'; // Import the FreelancerService
import './Freelancers.css';

const Freelancers = () => {
  const [freelancersList, setFreelancersList] = useState([]);
  const navigate = useNavigate(); // Updated hook

  useEffect(() => {
    // Fetch freelancers using FreelancerService
    listAll()
      .then(data => setFreelancersList(data))
      .catch(err => alert('Error fetching data: ' + err.message));
  }, []);

  const goBack = () => {
    navigate('/admin'); // Updated navigation
  };

  return (
    <div className="container-fluid">
      <div className="row g-3 text-center mt-3">
        <div className="col-3"></div>
        <div className="col-6">
          <div className="card ">
            <h5 className="card-title "><b>Freelancers List</b></h5>
            <div className="card-body">
              <table className="table table-hover table-striped table-primary table-bordered">
                <thead>
                  <tr>
                    <th>Unique Id</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>User Name</th>
                  </tr>
                </thead>
                <tbody>
                  {freelancersList.map(freelancer => (
                    <tr key={freelancer.id}>
                      <td>{freelancer.id}</td>
                      <td>{freelancer.firstName}</td>
                      <td>{freelancer.lastName}</td>
                      <td>{freelancer.userName}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
        <div className="col-3"></div>
      </div>
      <div className="row text-center mt-3">
        <div className="col-4"></div>
        <div className="col-4">
          <button className="btn btn-outline-danger shadow" onClick={goBack}>
            Go Back
          </button>
        </div>
        <div className="col-4"></div>
      </div>
    </div>
  );
};

export default Freelancers;
